var defaultUrn = 'urn:dXJuOmFkc2sub2JqZWN0czpvcy5vYmplY3Q6YWRudGVzdGJ1Y2tldC9lZjIzNGRmOC05YWIwLTExZTYtYWYyMy00MGYwMmY3YWM1MTQuZjNk';
var _viewer;

var viewerApp;

var timer = null;
var gCodePoints = JSON.parse(gcode).gcode;

var lasPT= null;
var firstPT = false;
var gCodeIndex = 0;

var cylinder =null;
var modelOffset = null;

var material = new THREE.LineBasicMaterial({ color: 0xff0000 });

function  drawLine()
{
    if(gCodeIndex >=gCodePoints.length)
    {
        clearInterval(timer);
        gCodeIndex = 0;;
        return;
    }
    if(gCodePoints[gCodeIndex].type=='m5')
    {
        //stop animation
        clearInterval(timer);
        gCodeIndex = 0;;
    }
    else if(gCodePoints[gCodeIndex].type=='g0')
    {
        gCodeIndex+=2;
        //g1 - z
        var z = parseFloat(gCodePoints[gCodeIndex].value.z - modelOffset.z+5);
        gCodeIndex++;
        //g1
        var x = parseFloat(gCodePoints[gCodeIndex].value.x- modelOffset.x);
        var y = parseFloat(gCodePoints[gCodeIndex].value.y- modelOffset.y);


        cylinder.translateX( x- lasPT.x);
        cylinder.translateZ(  y- lasPT.y );

        //build the first pt of next curve
        lasPT = new THREE.Vector3( x, y, z );

        _viewer.impl.invalidate(true);


    }
    else
    {
        //next point of current curve

        var x = parseFloat(gCodePoints[gCodeIndex].value.x- modelOffset.x);
        var y = parseFloat(gCodePoints[gCodeIndex].value.y- modelOffset.y);
        var z = lasPT.z;
        currentPT = new THREE.Vector3( x, y, z );

        var geometry = new THREE.Geometry();
        geometry.vertices.push( lasPT );
        geometry.vertices.push(currentPT);

        var newLine = new THREE.Line( geometry, material );

         _viewer.impl.scene.add(newLine);

        cylinder.translateX( x- lasPT.x);
        cylinder.translateZ(  y- lasPT.y );
        //cylinder.translateZ(  z- lasPT.z );

        //cylinder.translateX( x );
        //cylinder.translateY(  y  );
        //cylinder.translateZ(  z  );


        _viewer.impl.invalidate(true);

        lasPT = currentPT;
    }

    gCodeIndex++;
}

function loadView(urn)
{
    $.ajax ({
        url: 'http://' + window.location.host + '/ForgeRoute/gettoken',
        type: 'get',
        data: null,
        contentType: 'application/json',
        complete: null
    }).done (function (response) {
        if(response.err){
            console.log('get token error:' + response.err);
        }
        else {

            var token =  response.access_token;
            var options = {
                env: 'AutodeskProduction',
                accessToken: token
            };
            Autodesk.Viewing.Initializer(options, function onInitialized(){

                var config3d = {
                    // extensions: ['Autodesk.Viewing.Extensions.Collaboration']
                };
                viewerApp = new Autodesk.A360ViewingApplication('viewerDiv');
                viewerApp.registerViewer(viewerApp.k3D, Autodesk.Viewing.Private.GuiViewer3D,config3d);
                viewerApp.loadDocumentWithItemAndObject(urn);
            });
        }
    }).fail (function (xhr, ajaxOptions, thrownError) {
        console.log('get token error:' + response.err);
    }) ;
}

$(document).ready(function () {

    var paramUrn = Autodesk.Viewing.Private.getParameterByName('urn');
    var urn = (paramUrn !== '' ? paramUrn : defaultUrn);

    loadView(urn);

    $('#btndraw').click(function(evt){
        clearInterval(timer);
    });



    $("#addgeo").on("click", function(e){

        _viewer = viewerApp.myCurrentViewer;
        modelOffset = _viewer.model.getData().globalOffset;

        var geometry = new THREE.Geometry();
        gCodeIndex = 0;

        while (gCodePoints[gCodeIndex].type != 'g4') {
            gCodeIndex++;
        }

        gCodeIndex += 2;  //skipp g4 and g0

//g1 - z
        var z = parseFloat(gCodePoints[gCodeIndex].value.z - modelOffset.z+5);
        gCodeIndex++;
        var x = parseFloat(gCodePoints[gCodeIndex].value.x -  modelOffset.x);
        var y = parseFloat(gCodePoints[gCodeIndex].value.y-  modelOffset.y);

//build the first pt of first curve
        lasPT = new THREE.Vector3(x, y, z);

        gCodeIndex++;


        var geometry_cylinder = new THREE.CylinderGeometry( 5, 5, 20, 32 );
        var material_cylinder= new THREE.MeshBasicMaterial( {color: 0x999999} );
        cylinder = new THREE.Mesh( geometry_cylinder, material_cylinder );
        _viewer.impl.scene.add(cylinder);
        _viewer.impl.invalidate(true);

        cylinder.translateX( x );
        cylinder.translateZ( y );
        cylinder.translateY( z );
        cylinder.rotateX( 90 );



        timer = setInterval(drawLine, 500);
    });



});


function onError(error) {
    console.log('Error: ' + error);
};
